import React from 'react';
import Styled from 'styled-components';

const Text = (props) => {
	const Text = Styled.div`
        fontSize="1rem";
        height="100%";
        letterSpacing="1.5rem";
        color="#fff";
        fontFamily="gPro";
        lineHeight="1.5rem;
        }`;

	return <Text>{props.text}</Text>;
};
export default Text;
